<?php
/**
 * @package TabsTable
 */

namespace SanasanaInit\TabsTable;

use SanasanaInit\General\BaseController;
use WP_Query;

class TabsTableShortcode extends BaseController
{
    public function register()
    {
        add_shortcode('tabs', [$this, 'render_tabs_shortcode']);
		add_shortcode('evaluation-tabs', [$this, 'evaluation_tabs']);
    }

    public function render_tabs_shortcode($atts)
    {
        $atts = shortcode_atts(['name' => ''], $atts, 'tabs');
        $tab_name = sanitize_title($atts['name']);

        if (empty($tab_name)) {
            return '<p>No tabs found.</p>';
        }

        $query = new WP_Query([
            'post_type' => 'tabs',
            'name' => $tab_name,
            'posts_per_page' => 1
        ]);

        if (!$query->have_posts()) {
            return '<p>No tabs found.</p>';
        }

        $query->the_post();
        $post_id = get_the_ID();

        $tabs_data = get_post_meta($post_id, '_tabs_table_data', true);
        $tab_layout = get_post_meta($post_id, '_tabs_table_layout', true) ?: 'horizontal';

        wp_reset_postdata();

        if (empty($tabs_data) || !is_array($tabs_data)) {
            return '<p>No tabs available.</p>';
        }

        ob_start();
        ?>
        <div class="tab-container-desktop  tab-container-<?php echo esc_attr($tab_layout); ?>">
            <div class="progress-bar-container progress-bar-container-<?php echo esc_attr($tab_layout); ?>">
                <div class="progress-bar-back progress-bar-back-<?php echo esc_attr($tab_layout); ?>"></div>
                <div class="progress-bar progress-bar-<?php echo esc_attr($tab_layout); ?>"></div>
            </div>
            <div class="tabs-wrapper tabs-wrapper-<?php echo esc_attr($tab_layout); ?>">
                <ul class="nav-tabs-<?php echo esc_attr($tab_layout); ?>" id="scroll-tabs">
                    <?php foreach ($tabs_data as $index => $tab) : ?>
                        <li class="nav-item nav-item-<?php echo esc_attr($tab_layout); ?>">
                            <button class="nav-link <?php echo ($index === 0) ? 'active' : ''; ?>" 
                                data-index="<?php echo esc_attr($index); ?>">
                                <div class="tab-title"><?php echo esc_html($tab['title']); ?></div>
                                <div class="tab-excerpt"><?php echo esc_html($tab['excerpt']); ?></div>
                            </button>
                        </li>
                    <?php endforeach; ?>
                </ul>
            </div>

            <div class="tab-content-<?php echo esc_attr($tab_layout); ?>">
                <?php foreach ($tabs_data as $index => $tab) : ?>
                    <div class="tab-pane <?php echo ($index === 0) ? 'active' : ''; ?>">
                        <?php if (!empty($tab['image'])) : ?>
                            <div class="tab-image">
                                <img src="<?php echo esc_url($tab['image']); ?>" alt="<?php echo esc_attr($tab['title']); ?>" />
                            </div>
                        <?php endif; ?>
                        <div class="tab-content-text">
                            <?php echo wp_kses_post($tab['content'], 'sanasana'); ?>
                        </div>
                    </div>
                <?php endforeach; ?>
            </div>
        </div>
        <?php if($tab_layout == 'vertical'){ ?>
            <div class="tab-container-mobile  tab-container-vertical tab-container-vertical-mobile-vertical">
                <!--<div class="tabs-wrapper tabs-wrapper-mobile-vertical">
                    <ul class="nav-tabs-mobile-vertical nav-tabs-<?php echo esc_attr($tab_layout); ?>" id="scroll-tabs">
                        <?php foreach ($tabs_data as $index => $tab) : ?>
                            <li class="nav-item nav-item-mobile-vertical">
                                <button class="nav-link-mobile-vertical nav-link <?php echo ($index === 0) ? 'active' : ''; ?>" 
                                    data-index="<?php echo esc_attr($index); ?>">
                                    <div class="tab-title"><?php echo esc_html($tab['title']); ?></div>
                                </button>
                            </li>
                        <?php endforeach; ?>
                    </ul>
                </div>-->
                <div class="tab-content-<?php echo esc_attr($tab_layout); ?> tab-content-mobile-vertical">
                    <div class="nav-butons-mobile-vertical">
                        <div class="nav-button-prev-mobile-vertical">
                            <img src="<?php echo esc_url($this->plugin_url . 'assets/images/flecha-izquierda.png'); ?>" alt="Sanasana" />
                        </div>
                        <div class="nav-button-post-mobile-vertical">
                            <img src="<?php echo esc_url($this->plugin_url . 'assets/images/flecha-derecha.png'); ?>" alt="Sanasana" />
                        </div>
                    </div>
                    <?php foreach ($tabs_data as $index => $tab) : ?>
                        <div class="tab-pane <?php echo ($index === 0) ? 'active' : ''; ?> tab-pane-mobile-vertical">
                            <div class="nav-item nav-item-mobile-vertical">
                                <div class="nav-link-mobile-vertical nav-link <?php echo ($index === 0) ? 'active' : ''; ?>" 
                                    data-index="<?php echo esc_attr($index); ?>">
                                    <div class="tab-title"><?php echo esc_html($tab['title']); ?></div>
                                </div>
								<div class="nav-separator">
									
								</div>
                            </div>
							

                            <div class="tab-excerpt"><?php echo esc_html($tab['excerpt']); ?></div>

                            <?php if (!empty($tab['image'])) : ?>
                                <div class="tab-image">
                                    <img src="<?php echo esc_url($tab['image']); ?>" alt="<?php echo esc_attr($tab['title']); ?>" />
                                </div>
                            <?php endif; ?>
                        </div>
                    <?php endforeach; ?>
                </div>
            </div>
        <?php } else { ?>
            <div class="tab-container-mobile  tab-container-horizontal">
                <?php foreach ($tabs_data as $index => $tab) { ?>
                    <div class="tab-card-mobile-item">
                        <div class="tab-card-mobile-title">
                            <div class="tab-title"><?php echo esc_html($tab['title']); ?></div>
                        </div>
                        <div class="tab-card-mobile-excerpt">
                            <div class="tab-excerpt"><?php echo esc_html($tab['excerpt']); ?></div>
                        </div>
                        <div class="tab-card-mobile-content">
                            <?php echo wp_kses_post($tab['content']); ?>
                        </div>
                        <div class="tab-card-mobile-image">
                            <?php if (!empty($tab['image'])) : ?>
                                <div class="tab-image">
                                    <img src="<?php echo esc_url($tab['image']); ?>" alt="<?php echo esc_attr($tab['title']); ?>" />
                                </div>
                            <?php endif; ?>
                        </div>
                    </div>
                <?php } ?>
            </div>
        <?php }
        return ob_get_clean();
    }
	
