		<script>
			
			jQuery(document).ready(function ($) {
  const ACTIVE   = '#5166EC';
  const INACTIVE = '#ABAAA6';

  // Pintar estado inicial (segn el .active que ya tengas en el HTML)
  $('.tab-titles a').each(function () {
    const $a = $(this);
    const color = $a.hasClass('active') ? ACTIVE : INACTIVE;
    // Colorea svg y todos los fills (excepto fill="none")
    $a.find('svg').attr('fill', color)
      .find('[fill]:not([fill="none"])').attr('fill', color);
    // Si tu cono usa stroke:
    $a.find('svg [stroke]').attr('stroke', color);
  });

  // Click en tabs
  $('.tab-titles').on('click', 'a', function (e) {
    e.preventDefault();

    // Desactivar actual
    $('.tab-titles a.active').removeClass('active');
    $('.tab-content.active').removeClass('active');

    // Poner todos los conos en INACTIVE
    $('.tab-titles a svg').attr('fill', INACTIVE)
      .find('[fill]:not([fill="none"])').attr('fill', INACTIVE);
    $('.tab-titles a svg [stroke]').attr('stroke', INACTIVE);

    // Activar el clicado
    const $link = $(this).addClass('active');
    $($link.attr('href')).addClass('active');

    // Pintar el cono activo
    $link.find('svg').attr('fill', ACTIVE)
      .find('[fill]:not([fill="none"])').attr('fill', ACTIVE);
    $link.find('svg [stroke]').attr('stroke', ACTIVE);
  });
});


		</script>

